import React, { useState, useEffect } from "react";
import axios from "axios";
import "./App.css"; // Import CSS file for styling

function App() {
  const [tasks, setTasks] = useState([]);
  const [date, setDate] = useState("");
  const [task, setTask] = useState("");
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [userId, setUserId] = useState("");
  const [filteredDate, setFilteredDate] = useState("");
  const [filteredTasks, setFilteredTasks] = useState([]);

  useEffect(() => {
    fetchTasks();
  }, [userId]);

  const fetchTasks = async () => {
    try {
      const response = await axios.get(`/tasks/${userId}`);
      setTasks(response.data);
    } catch (error) {
      console.error("Error fetching tasks:", error);
    }
  };

  const addTask = async () => {
    try {
      await axios.post(`/task/${userId}`, { date, task });
      setDate("");
      setTask("");
      fetchTasks();
    } catch (error) {
      console.error("Error adding task:", error);
    }
  };

  const deleteTask = async (id) => {
    try {
      await axios.delete(`/task/${userId}/${id}`);
      fetchTasks();
    } catch (error) {
      console.error("Error deleting task:", error);
    }
  };

  const handleSignup = async () => {
    try {
      await axios.post("/signup", { username, password });
      alert("Signup successful");
    } catch (error) {
      alert(error.response.data.error || "Signup failed");
    }
  };

  const handleLogin = async () => {
    try {
      const response = await axios.post("/login", { username, password });
      alert("Login successful");
      setIsLoggedIn(true);
      setUserId(response.data.userId);
    } catch (error) {
      alert(error.response.data.error || "Login failed");
    }
  };

  const handleFilter = () => {
    setFilteredTasks(tasks.filter((task) => task.date === filteredDate));
  };

  if (!isLoggedIn) {
    return (
      <div className="app-container">
        <h1>Login</h1>
        <div className="login-container">
          <input
            type="text"
            placeholder="Username"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
          />
          <input
            type="password"
            placeholder="Password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
          <div>
            <button onClick={handleSignup}>Sign Up</button>
            <button onClick={handleLogin}>Login</button>
          </div>
        </div>
      </div>
    );
  }

  return (
    <>
      <div className="app-container">
        <h1>To-Do List</h1>
        <div className="input-container">
          <input
            type="date"
            value={date}
            onChange={(e) => setDate(e.target.value)}
            className="input-date"
          />
          <input
            type="text"
            value={task}
            onChange={(e) => setTask(e.target.value)}
            className="input-task"
          />
          <button onClick={addTask} className="add-button">
            Add Task
          </button>
        </div>
        <div className="filter-container">
          <input
            type="date"
            value={filteredDate}
            onChange={(e) => setFilteredDate(e.target.value)}
            className="input-date"
          />
          <button onClick={handleFilter} className="filter-button">
            Filter
          </button>
        </div>
        <ul className="task-list">
          {filteredTasks.length > 0
            ? filteredTasks.map((task) => (
                <li key={task.id} className="task-item">
                  <span>{task.date}</span>
                  <span>{task.task}</span>
                  <button
                    onClick={() => deleteTask(task.id)}
                    className="delete-button"
                  >
                    Delete
                  </button>
                </li>
              ))
            : tasks.map((task) => (
                <li key={task.id} className="task-item">
                  <span>{task.date}</span>
                  <span>{task.task}</span>
                  <button
                    onClick={() => deleteTask(task.id)}
                    className="delete-button"
                  >
                    Delete
                  </button>
                </li>
              ))}
        </ul>
      </div>
    </>
  );
}

export default App;
